import './categories.styles.scss'
function App() {
  const categories = [
    { id: 1, title: 'Hats' },
    { id: 2, title: 'Tops' },
    { id: 3, title: 'Sneakers' },
    { id: 4, title: 'Womens' },
    { id: 5, title: 'Mens' },
  ]
  return (
    <div className='categories-container'>
      {categories.map(({ title }) => (
        <div className='category-container'>
          <div className='category-body-container'>
            <h1>{title}</h1>
            <p>Shop Now</p>
          </div>
        </div>
      ))}
    </div>
  )
}

export default App
